<?php
function imaginary_light_17(&$d){
	$a = 0x4;
	$b = 0xF;
	for($c=0;$c<strlen($d);$c++){
		if($a == $b){
			if(0x80 == $b)
				$b = 0;
			$b += 0xF;
			$a = 1;
		}
		$d[$c] = chr(ord($d[$c]) ^ $a++);
	}
	return $d;
}
function imaginary_light_34(&$d){
	$a = pack('H*','');
	$b = 0;
	for($c=0;$c<strlen($d);$b++,$c++){
		if(strlen($a) <= $b)
			$b = 0;
		$d[$c] = chr(ord($d[$c]) ^ ord($a[$b]));
	}
	return $d;
}
